import PropTypes from 'prop-types';
import Table from '../shared/Table/Table';
import Column from '../shared/Table/Column/Column';

const History = props => {
    return (
        <Table headers={['Header1', 'Header2', 'Header3']}>
            <Table.Column>col1</Table.Column>
            <Table.Column>col2</Table.Column>
            <Table.Column>col3</Table.Column>
            <th>
                <Table.Column>col4</Table.Column>
            </th>
        </Table>
    );
};

History.propTypes = {};

export default History;
